import logo from "../images/logo.svg";
import { useHistory } from "react-router-dom";

function Header(props) {
  const history = useHistory();

  function handleClick() {
    if (props.redirect === "Sign up") {
      history.push("/register");
    }
    if (props.redirect === "Log in") {
      history.push("/login");
    }
  }

  return (
    <header className="header">
      <ul className="header__container">
        <img className="header__logo" src={logo} alt="Logo de Around The US" />
        <div className="header__login">
          <li className="header__item">{props.email}</li>
          <li className="header__item">
            <button
              className="header__button hover-button"
              onClick={
                props.redirect === "Cerrar Sesión" ? props.signOut : handleClick
              }
            >
              {props.redirect}
            </button>
          </li>
        </div>
      </ul>
      <hr className="header__line" />
    </header>
  );
}

export default Header;
